import L from 'leaflet';

const Icon = new L.Icon({
    iconUrl: require('../img/parking.png'),
    iconRetinaUrl: require('../img/parking.png'),
    iconAnchor: null,
    popupAnchor: null,
    shadowUrl: null,
    shadowSize: null,
    shadowAnchor: null,
    iconSize: new L.Point(60, 75),
    className: 'leaflet-div-icon'
});

export { Icon };
